pui.runtimeText.fr_FR["job descr"]="Description du job";pui.runtimeText.fr_FR["job descr hlp"]="Sp\u00e9cifie la description du job afin d'en d\u00e9duire la liste des biblioth\u00e8ques. *USRPRF peut \u00eatre sp\u00e9cifi\u00e9 si les utilisateurs de l'Atrium ont des profils IBM i.";pui.runtimeText.fr_FR["job descr lib"]="Biblioth\u00e8que de la description du job";pui.runtimeText.fr_FR["job descr lib hlp"]="Sp\u00e9cifie la biblioth\u00e8que pour la description du job. *LIBL ou *CURLIB peuvent \u00eatre sp\u00e9cifi\u00e9es.";
pui.runtimeText.fr_FR["item name"]="Nom de l'\u00e9l\u00e9ment";pui.runtimeText.fr_FR["item name hlp"]="D\u00e9finit le nom d'affichage de l'\u00e9l\u00e9ment de navigation ou de la barre d'outils.";pui.runtimeText.fr_FR["action type"]="Type d'action";pui.runtimeText.fr_FR["action type hlp"]="D\u00e9finit le type de l'application lanc\u00e9e par cet \u00e9l\u00e9ment.";pui.runtimeText.fr_FR.url="URL";pui.runtimeText.fr_FR["url hlp"]="D\u00e9finit l'URL de l'application Web. L'URL peut \u00eatre aboslue ou relative. Des param\u00e8tres de requ\u00eate peuvent \u00eatre sp\u00e9cifi\u00e9s dans l'URL.";
pui.runtimeText.fr_FR["genie url"]="URL Genie";pui.runtimeText.fr_FR["genie url hlp"]="D\u00e9finit l'URL utilis\u00e9e pour lancer le Genie. Si non sp\u00e9cifi\u00e9e, l'URL Genie par d\u00e9faut /profoundui/auth/genie sera utilis\u00e9e. Ce champ est utile dans le cas d'une URL Genie personnalis\u00e9e ou lorsque des param\u00e8tres de requ\u00eates sont n\u00e9cessaires. par exemple : /profoundui/auth/genie?skin=MyCompany";pui.runtimeText.fr_FR["open as"]="Ouvrir en tant que";
pui.runtimeText.fr_FR["open as hlp"]="D\u00e9finit si l'\u00e9l\u00e9ment doit \u00eatre ouvert dans un nouvel onglet du portail ou en tant que nouvelle fen\u00eatre/nouvel onglet du navigateur. L'utilisation d'une fen\u00eatre ou onglet du navigateur d\u00e9pend des r\u00e9glages de celui-ci.";pui.runtimeText.fr_FR["opens once only"]="Ex\u00e9cution unique";pui.runtimeText.fr_FR["opens once only hlp"]="Par d\u00e9faut, si l'utilisateur ex\u00e9cute l'\u00e9l\u00e9ment alors que celui-ci est d\u00e9j\u00e0 ouvert dans le portail, un nouvel onglet est utilis\u00e9. Il n'y a pas de limite du nombre d'onglets que l'utilisateur est capable d'ouvrir de cette fa\u00e7on. Quand cette option est coch\u00e9e, l'utilisateur ne pourra ouvrir qu'un seul onglet correspondant \u00e0 cet \u00e9l\u00e9ment. Si l'onglet est d\u00e9j\u00e0 ouvert, le fait d'ex\u00e9cuter l'\u00e9l\u00e9ment activera cet onglet. Cette option est ignor\u00e9e si l'\u00e9l\u00e9ment s'ouvre dans une nouvelle fen\u00eatre ou un nouvel onglet du navigateur.";
pui.runtimeText.fr_FR.icon="Ic\u00f4ne";pui.runtimeText.fr_FR["icon hlp"]="Optionnel. D\u00e9finit l'ic\u00f4ne utilis\u00e9e dans le menu de navigation ou la barre d'outils. L'ic\u00f4ne peut \u00eatre au format GIF, JPG ou PNG. Les GIF transparents sont recommand\u00e9s. Le chemin devra \u00eatre sp\u00e9cifi\u00e9 en absolu depuis le r\u00e9pertoire racine d'installation de l'Atrium. Si aucune ic\u00f4ne n'est sp\u00e9cifi\u00e9e, l'Atrium utilisera l'ic\u00f4ne par d\u00e9faut pour les \u00e9l\u00e9ments de navigation. Aucune ic\u00f4ne ne sera affich\u00e9e pour les \u00e9l\u00e9ments de la barre d'outils sauf si sp\u00e9cifi\u00e9e ici.";
pui.runtimeText.fr_FR.parameter="Param\u00e8tre";pui.runtimeText.fr_FR["parameter hlp"]="Optionnel: S\u00e9pcifie un param\u00e8tre qui sera pass\u00e9 au program Rich Display lors de son ex\u00e9cution.";pui.ue("en_US","fr_CA");pui.runtimeMsg.fr_CA.closeMessage="Votre session sera ferm\u00e9e.";pui.runtimeMsg.fr_CA["no connection message"]="Impossible d'acc\u00e9der le serveur.  Veuillez v\u00e9rifier votre connexion et r\u00e9essayer.";pui.runtimeMsg.fr_CA["upload file limit"]="La limite de &1 fichier(s) est d\u00e9pass\u00e9e.";
