pui.runtimeText.nl_NL["job descr lib"]="Job description bibliotheek";pui.runtimeText.nl_NL["job descr lib hlp"]="Geef de bibliotheek op met de job description. Hier kan *LIBL of *CURLIB worden opgegeven.";pui.runtimeText.nl_NL["item name"]="Naam item";pui.runtimeText.nl_NL["item name hlp"]="Stelt de naam in van het display voor het navigatie of toolbar item.";pui.runtimeText.nl_NL["action type"]="Actie type";pui.runtimeText.nl_NL["action type hlp"]="Stelt het type toepassing in dat door dit item wordt gestart.";
pui.runtimeText.nl_NL.url="URL";pui.runtimeText.nl_NL["url hlp"]="Stelt de URL in van de Web toepassing. De URL kan worden opgegeven als een absoluut pad of als een volledig gekwalificeerde URL. In de URL kunnen Query string parameters worden meegegeven.";pui.runtimeText.nl_NL["genie url"]="Genie URL";pui.runtimeText.nl_NL["genie url hlp"]="Stelt de URL in die wordt gebruikt om Genie te starten. Als hier niets wordt ingevuld wordt de standaard Genie URL /profoundui/auth/genie gebruikt. Dit veld is handig als er een andere Genie URL nodig is of als er met query string parameters wordt  gewerkt. Bijvoorbeeld: /profoundui/auth/genie?skin=MyCompany";
pui.runtimeText.nl_NL["open as"]="Openen als";pui.runtimeText.nl_NL["open as hlp"]="Keuze of de toepassing onder een nieuwe tab in de portal wordt gestart, of in een afzonderlijke browser window of een tab. Of de browser een nieuwe window gebruikt of een tab is afhankelijk van de gebruikersinstelling in de browser.";pui.runtimeText.nl_NL["opens once only"]="Open eenmalig";pui.runtimeText.nl_NL["opens once only hlp"]="Standaard wordt er een nieuwe tab geopend met het opstarten van een item. Als er al een tab is geopend in de portal wordt er een nieuwe toegevoegd. Er is geen limiet aan het aantal tabs dat op deze manier kan worden geopend. Als deze optie wordt aangevinkt kan de gebruiker niet meer dan 1 tab per item openen. Als er al een tab is geopend voor dit item zal deze na de selectie worden gebruikt. Deze optie is niet actief als er is gekozen voor het openen van het item in een afzonderlijk browser window of tab.";
pui.runtimeText.nl_NL.icon="Icon";pui.runtimeText.nl_NL["icon hlp"]="Optioneel. Geef de naam op van een icon file voor gebruik door het navigatie of toolbar item. Geldige icon file formaten zijn GIF, JPG, or PNG. Het wordt aanbevolen om transparente GIFs te gebruiken. Gebruik het absolute pad van de root van de Atrium installatie. Als er geen icon is opgegeven gebruikt Atrium een default icon voor de navigatie. Mits hier opgegeven, worden er geen icons voor de toolbar items getoond.";
